import { FETCH_PHOTO, FETCH_TODOS } from '../actions/types';

const initialState = {
    photo: {},
    todos: [],
    loading: true
}

export default function(state = initialState, action) {
    switch(action.type) {
        case FETCH_PHOTO:
            return {
                ...state,
                photo: action.payload
            }
        case FETCH_TODOS:
            return {
                ...state,
                todos: action.payload
            }
        default:
            return state;
    }
}
